import './App.css'
import { Route } from 'react-router-dom';

import AllWinesPage from './Pages/AllWines';
import ProfilePage from './Pages/Profile';
import QuizPage from './Pages/Quiz';

function App() {
  return <div>
    <Route path='/'>
      <AllWinesPage />
    </Route>
    <Route path='/profile'>
      <ProfilePage></ProfilePage>
    </Route>
  </div>
}

export default App;
